                    fetch("http://localhost:5000/api/horario/" + usuarioHorario.idHorario)
                        .then(res => res.json())
                        .then((resulta) => {
                            this.setState({ dadosHorarios: [...this.state.dadosHorarios, resulta] })
                            console.log("a")
                            
                        })
                })*/

                /*this.state.horarios.map((horario) => {
                    
                    document.createElement("div").innerHTML += `<div class='caixa'>< h1 > ${horario.materia}<br /><small>${horario.diaSemana} às ${horario.horario}</small><br /><br /><button class='desmarcar'>Desmarcar</button></div >`
                })*/
            },
                (error) => {
                }
            )

        fetch("http://localhost:5000/api/horario")
            .then(res => res.json())
            .then((result) => {
                this.setState({ horarios: result });

            }, (error) => {
            }
            )
    }

    constructor(props) {
        super(props);
        this.state = { ...stateInicial }

    }

    render2() {
        this.componentDidMount()
        const { dadosHorarios } = this.state.dadosHorarios
        const { horarios } = this.state.horarios

        return (
            <div>
                <div className="invis" id="invis"></div>
                <div className="invis"><Ra></Ra></div>
                <div className="menu">
                    <span><Link to="/">Início</Link></span>
                    <span><Link to="/agendamentos">Meus agendamentos</Link></span>
                    <span><Link to="/logoff">Logoff</Link></span>
                </div>
                <img src={Simbolo} alt="Monitorário" id="img" />
                <div className="aux"><Rodape /></div>
                <div className="emCima"></div>
                <div className="aux2"></div>
                <div className="content has-shown">
                    <h1 className="titulo"><b>Meus agendamentos</b></h1>
                    {
                        /*dadosHorarios.map(
                            (horario) => {
                                //<Agendado materia={result.materia} diaSemana={result.diaSemana} horario={result.horario} />
                                return (<div className="caixa">
                                    <h1>{horario.materia}</h1>
                                    <br />
                                    <small>{horario.diaSemana} às {horario.horario}</small>
                                    <br /><br />
                                    <button className="desmarcar">Desmarcar</button>
                                </div>)
                            }
                        )  */
                        dadosHorarios.map(
                            (dadoHorario) => (
                                horarios.map(
                                    (horario) => (
                                        dadoHorario.raUsuario === document.getElementById("ra").innerHTML && dadoHorario.idHorario === horario.idHorario ?
                                            <div className="caixa">
                                                <h1>{horario.materia}</h1>
                                                <br />
                                                <small>{horario.diaSemana} às {horario.horario}</small>
                                                <br /><br />
                                                <button className="desmarcar">Desmarcar</button>
                                            </div> : null
                                    )
                                )
                            )
                        )
                    }

                </div>
            </div>
        )

    }

    render() {
        // const { dadosHorarios } = this.state.dadosHorarios
        // const { horarios } = this.state.horarios
        // return (
        //     <div>
        //         <div className="invis" id="invis"></div>
